class BamFocusBoxView extends widgets_controls.BoxView {
    initialize(parameters) {
        super.initialize(parameters);
        // console.log("initialize BamFocusBox")
        // window.flolo = this

        // enable the div to be focusable in order to be able to catch the keyboard events
        this.$el[0].tabIndex = 0

        // input if we want to control the behavior of what gets selected after a tab:
        // we might create a loop, eg selecting the first element in a row again
        // we might not allow to focus past a certain element
        // https://stackoverflow.com/questions/7208161/focus-next-element-in-tab-index

        this.$el.on("keydown", (event) => {
            // console.log("FocusBox keydown", true)
            // dont propagate event to jupyter because this will interact with the editor
            event.stopPropagation()

            // // prevent the default browser action, eg scrolling on mouse up or down arrow
            // // but this also prevents the typing in the controls
            // event.preventDefault()
        })
            .on("keyup", (event) => {
                // console.log("FocusBox keyup", true)
                event.stopPropagation()
            })
            .on("keypress", (event) => {
                // console.log("FocusBox keypress", true)
                event.stopPropagation()
            })
            .on("click", (event) => {
                // console.log("FocusBox click", true)
                event.stopPropagation()
            })
    }
}


